var api;
    
r.placeModule('', function(require) {
        api = require('api');
        window.api = api;
    });

var functionList = pixels.map((pixel) => {
    return function(){
        if (api.getPixelInfo) {
            api.getPixelInfo(pixel.x, pixel.y).then((data) => {
                if (data.color !== pixel.colorIndex) {
                    r.place.setColor(pixel.colorIndex);
                    var y = r.place.drawTile(pixel.x, pixel.y);
                    console.log(`put color ${pixel.colorIndex} at {${pixel.x}, ${pixel.y}}`);
                }                
            })
        }       
    }    
});

function runAndRequeue(){
    var timeUntilCooldownOver = r.place.cooldownEndTime - (new Date()).getTime();
    if (timeUntilCooldownOver < 0) {
        var fun = functionList.shift();
        functionList.push(fun);
        fun();
        setTimeout(runAndRequeue, 0);
    } else {
        console.log("Waiting for timeout to be over")
        setTimeout(runAndRequeue, timeUntilCooldownOver);
    }    
}

runAndRequeue();
